unanticipated
     adj : not anticipated; "unanticipated and disconcerting lines of
           development"- H.W.Glidden; "unforeseen circumstances";
           "a virtue unlooked-for in people so full of energy";
           "like a bolt out of the blue" [syn: {unforeseen}, {unlooked-for},
            {out of the blue(p)}]
